import { useEffect, useState } from "react"
import '../Style/crypto.css'

type Props = {
    showSellButton: Boolean
}

export const EthereumComponent: React.FC = () => {

    const [ETC, setETC] = useState<String>()
 
    useEffect(() => {
        const pricesWs = new WebSocket('wss://ws.coincap.io/prices?assets=ethereum')

        pricesWs.onmessage = msg => {
            const value = JSON.parse(msg.data)
            setETC(Object.values(value).toString())
        }

        return () => {
            pricesWs.close();
        }
    })

    return(
        <div className="crypto-container">
            <p className="crypto-name">Ethereum</p>
            <section>
                <p className="crypto-in-USD">{ETC}</p>
            </section>
        </div>
    )
}
